import React from 'react';
import { motion } from 'framer-motion';
interface Navbar {
    darkMode: boolean;
    handleScroll: (target: React.MutableRefObject<HTMLDivElement | null>) => void;
    allRefs: React.MutableRefObject<HTMLDivElement | null>[];
    isScrolled?: boolean;
}

export default function Navbar(props:Navbar) {
    const {darkMode, handleScroll, allRefs} = props;
    const [homeRef, aboutRef, projectRef, contactRef] = allRefs;

    const homeLI = () => {
        return (
            <li onClick={() => handleScroll(homeRef)}>
                <a className="nav-item">Lawrence Han</a>
            </li>  
        )
    }

    return (
        <ul className={`navbar ${darkMode && "dark"}`}>
            <li onClick={() => handleScroll(aboutRef)}>
                <a className="nav-item">about</a>
            </li>
            <li onClick={() => handleScroll(projectRef)}>
                <a className="nav-item">experience / projects</a>
            </li>
            <li onClick={() => handleScroll(contactRef)}>
                <a className="nav-item">contact</a>
            </li>
        </ul>
    )
}
